import { Grid, Container } from '@mui/material';
import RoleForm from './RoleForm';
import RoleTable from './RoleTable';

function Role() {
    return (
        <>

            <Container maxWidth="lg">
                <Grid
                    container
                    direction="row"
                    justifyContent="center"
                    alignItems="stretch"
                    spacing={3}
                >
                    <Grid item xs={12}>
                        <RoleForm />
                    </Grid>
                    <Grid item xs={12}>
                        <RoleTable />
                    </Grid>
                </Grid>
            </Container>
        </>
    );
}

export default Role;
